(721, 'edd_sl_609ae11585be436291a4a56797acb272', 'a:2:{s:7:\"timeout\";i:1598952912;s:5:\"value\";s:13698:\"{\"new_version\":\"2.8.1\",\"stable_version\":\"2.8.1\",\"name\":\"Polylang Pro\",\"slug\":\"polylang\",\"url\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/?changelog=1\",\"last_updated\":\"7 days ago\",\"homepage\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/\",\"package\":\"\",\"download_link\":\"\",\"sections\":{\"description\":\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\",\"changelog\":\"<h4> 2.8.1 (2020-08-25) <\\/h4>\\n<ul>\\n<li>Pro: Fix fatal error with WP 4.9<\\/li>\\n<li>Fix pll_the_languages() with \'raw\' option returning html flag instead of flag url #558<\\/li>\\n<li>Fix compatibility with Duplicate Posts not correcly loaded #557<\\/li>\\n<li>Fix custom flag size in admin bar language switcher #559<\\/li>\\n<li>Fix tag clouds mixed in the classic editor #561<\\/li>\\n<\\/ul>\\n<h4> 2.8 (2020-08-17) <\\/h4>\\n<ul>\\n<li>Pro: Add a language switcher block<\\/li>\\n<li>Pro: Add compatibility with block image edition introduced in WP 5.5<\\/li>\\n<li>Pro: Fix our private taxonomies being displayed in the ACF field group rules.<\\/li>\\n<li>Pro: Fix incorrect flags loaded from the block editor<\\/li>\\n<li>Pro: Fix SSO causing a wrong redirect when using subdomains (introduced in 2.7.4)<\\/li>\\n<li>Pro: Fix a performance issue on the plugins list<\\/li>\\n<li>Pro: Fix option to automatically duplicate media in all languages when uploading a new file not honored in block image<\\/li>\\n<li>Use composer for autoload and Polylang Pro dependency on Polylang<\\/li>\\n<li>Display a flag for each post in the posts list tables (same for terms). #515<\\/li>\\n<li>Add test for the homepage translations to Site Health<\\/li>\\n<li>Add debug information to Site Health<\\/li>\\n<li>Add compatibility with the sitemaps introduced in WP 5.5 #451<\\/li>\\n<li>Always filter WP_Query by the current language<\\/li>\\n<li>Support wildcards in &quot;admin-texts&quot; parent keys in wpml-config.xml<\\/li>\\n<li>Fix sticky posts showed for all languages when the admin language filter is active #469<\\/li>\\n<li>Fix a performance issue on the pages list<\\/li>\\n<li>Fix dependency to jQuery Migrate removed from WP 5.5 #539<\\/li>\\n<li>Fix: output secure cookie when using a cache plugin and ssl #542<\\/li>\\n<li>Fix the possibility to create 2 terms with the same name in the same language, without specifying the second slug.<\\/li>\\n<li>Fix sticky posts appearing 2 times in WP 5.5<\\/li>\\n<\\/ul>\\n<h4> 2.7.4 (2020-06-29) <\\/h4>\\n<ul>\\n<li>Pro: Allow using our \\/untranslated-posts REST endpoint for non-public post types<\\/li>\\n<li>Pro: Fix broken display in the block editor sidebar when a language has no flag<\\/li>\\n<li>Pro: Fix SSO breaking the preview on secondary domains<\\/li>\\n<li>Pro: Fix ACF translation option not working for term custom fields<\\/li>\\n<li>Pro: Fix a styling issue in the fields group list table in ACF 5.9<\\/li>\\n<li>Add Spanish from Puerto Rico to the predefined list of languages<\\/li>\\n<\\/ul>\\n<h4> 2.7.3 (2020-05-26) <\\/h4>\\n<ul>\\n<li>Security: Slash metas<\\/li>\\n<li>Pro: Fix categories not savedafter the language has been switched in the block editor<\\/li>\\n<li>Pro: Fix ACF fields stored as integers instead of strings<\\/li>\\n<li>Pro: Fix ACF untranslated posts or terms being copied when creating a new translation<\\/li>\\n<li>Pro: Fix PHP notice with ACF when a repeater or group is included in a flexible content<\\/li>\\n<li>Pro: Fix &quot;DevTools failed to load SourceMap&quot; warning in browser console<\\/li>\\n<li>Update plugin updater to 1.7.1<\\/li>\\n<li>Honor the filter &quot;pll_the_language_link&quot; when the language switcher displays a dropdown #506<\\/li>\\n<li>Fix &quot;Something went wrong&quot; message when quick editing untranslated post types #508<\\/li>\\n<li>Fix wpseo_opengraph deprecated warning #509<\\/li>\\n<\\/ul>\\n<h4> 2.7.2 (2020-04-27) <\\/h4>\\n<ul>\\n<li>Pro: Re-allow to modify the capability for strings translations<\\/li>\\n<li>Pro: Fix redirect for posts having the same slug as a media<\\/li>\\n<li>Pro: Fix PHP notice with ACF flexible content<\\/li>\\n<li>Pro: Fix a fatal error with InfiniteWP<\\/li>\\n<li>Update plugin updater to 1.7<\\/li>\\n<li>Fix font in setup wizard<\\/li>\\n<\\/ul>\\n<h4> 2.7.1 (2020-04-09) <\\/h4>\\n<ul>\\n<li>Pro: Fix untranslated post types filtered by the parameter in the REST API #493<\\/li>\\n<li>Fix fatal error when the function idn_to_ascii is not available<\\/li>\\n<li>Fix PHP warning warning when a 3rd party plugin declares options not stored in DB in wpml-config.xml #492<\\/li>\\n<li>Fix fatal error when a 3rd party plugin declares options stored as objects in wpml-config.xml #494<\\/li>\\n<\\/ul>\\n<h4> 2.7 (2020-04-06) <\\/h4>\\n<ul>\\n<li>Minimum WordPress version is now 4.9<\\/li>\\n<li>Pro: Strings translations can now be exported and imported (in PO format)<\\/li>\\n<li>Pro: Allow to decide individually which ACF fields to copy or synchronize<\\/li>\\n<li>Pro: Add action pll_inactive_language_requested<\\/li>\\n<li>Pro; Fix fatal error in The Events Calendar compatibility when no language is defined yet<\\/li>\\n<li>Pro: Fix bulk translate when a post has no language<\\/li>\\n<li>Pro: Fix reusable block saved without language<\\/li>\\n<li>Pro: Fix post requested by slug not filtered in REST API, when the slug is shared<\\/li>\\n<li>Add a setup wizard<\\/li>\\n<li>Add Swahili, Upper Sorbian, Sindhi and Spanish from Uruguay to the list of predefined languages<\\/li>\\n<li>Add flags in the predefined list of languages<\\/li>\\n<li>Allow to hide the metaboxes from the screen options<\\/li>\\n<li>The deletion of the plugin\'s data at uninstall is now controlled by a PHP constant instead of an option #456<\\/li>\\n<li>Add parent in ajax response when selecting a term in autocomplete field #328<\\/li>\\n<li>Add Vary: Accept-Language http header in home page redirect. Props @chesio #452<\\/li>\\n<li>Improve performance to register\\/unregister WPML strings<\\/li>\\n<li>Add support for the action wpml_switch_language<\\/li>\\n<li>Add post_status to the list of accepted args of pll_count_posts()<\\/li>\\n<li>Apply the filter pll_preferred_language in wp-login.php<\\/li>\\n<li>Use filtered wrappers to create meta when creating media translations #231<\\/li>\\n<li>Allow to translate the Twenty Seventeen header video Youtube url #460<\\/li>\\n<li>Notices are now dismissed per site instead of per user #478<\\/li>\\n<li>Fix terms not visible in the quick edit when only one language is defined and teh admin language filter is active<\\/li>\\n<li>Fix post state not displayed for translations of the privacy policy page #395<\\/li>\\n<li>Fix wildcards not correctly interpreted in wpml-config.xml<\\/li>\\n<li>Fix product categories with special characters duplicated when importing WooCommerce products #474<\\/li>\\n<\\/ul>\\n<p>See <a href=\\\"https:\\/\\/plugins.svn.wordpress.org\\/polylang\\/trunk\\/changelog.txt\\\">changelog.txt<\\/a> for older changelog<\\/p>\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":{\"1x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\",\"2x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\"},\"tested\":\"5.5\",\"compatibility\":\"a:1:{s:5:\\\"5.2.3\\\";a:1:{s:6:\\\"1.5.23\\\";a:3:{i:0;s:4:\\\"100%\\\";i:1;s:1:\\\"5\\\";i:2;s:1:\\\"5\\\";}}}\",\"stable_tag\":\"2.8.1\",\"description\":[\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\"],\"changelog\":[\"<h4> 2.8.1 (2020-08-25) <\\/h4>\\n<ul>\\n<li>Pro: Fix fatal error with WP 4.9<\\/li>\\n<li>Fix pll_the_languages() with \'raw\' option returning html flag instead of flag url #558<\\/li>\\n<li>Fix compatibility with Duplicate Posts not correcly 