s objects in wpml-config.xml #494<\\/li>\\n<\\/ul>\\n<h4> 2.7 (2020-04-06) <\\/h4>\\n<ul>\\n<li>Minimum WordPress version is now 4.9<\\/li>\\n<li>Pro: Strings translations can now be exported and imported (in PO format)<\\/li>\\n<li>Pro: Allow to decide individually which ACF fields to copy or synchronize<\\/li>\\n<li>Pro: Add action pll_inactive_language_requested<\\/li>\\n<li>Pro; Fix fatal error in The Events Calendar compatibility when no language is defined yet<\\/li>\\n<li>Pro: Fix bulk translate when a post has no language<\\/li>\\n<li>Pro: Fix reusable block saved without language<\\/li>\\n<li>Pro: Fix post requested by slug not filtered in REST API, when the slug is shared<\\/li>\\n<li>Add a setup wizard<\\/li>\\n<li>Add Swahili, Upper Sorbian, Sindhi and Spanish from Uruguay to the list of predefined languages<\\/li>\\n<li>Add flags in the predefined list of languages<\\/li>\\n<li>Allow to hide the metaboxes from the screen options<\\/li>\\n<li>The deletion of the plugin\'s data at uninstall is now controlled by a PHP constant instead of an option #456<\\/li>\\n<li>Add parent in ajax response when selecting a term in autocomplete field #328<\\/li>\\n<li>Add Vary: Accept-Language http header in home page redirect. Props @chesio #452<\\/li>\\n<li>Improve performance to register\\/unregister WPML strings<\\/li>\\n<li>Add support for the action wpml_switch_language<\\/li>\\n<li>Add post_status to the list of accepted args of pll_count_posts()<\\/li>\\n<li>Apply the filter pll_preferred_language in wp-login.php<\\/li>\\n<li>Use filtered wrappers to create meta when creating media translations #231<\\/li>\\n<li>Allow to translate the Twenty Seventeen header video Youtube url #460<\\/li>\\n<li>Notices are now dismissed per site instead of per user #478<\\/li>\\n<li>Fix terms not visible in the quick edit when only one language is defined and teh admin language filter is active<\\/li>\\n<li>Fix post state not displayed for translations of the privacy policy page #395<\\/li>\\n<li>Fix wildcards not correctly interpreted in wpml-config.xml<\\/li>\\n<li>Fix product categories with special characters duplicated when importing WooCommerce products #474<\\/li>\\n<\\/ul>\\n<p>See <a href=\\\"https:\\/\\/plugins.svn.wordpress.org\\/polylang\\/trunk\\/changelog.txt\\\">changelog.txt<\\/a> for older changelog<\\/p>\"]}\";}', 'no'),
