(1328, 446, 'blocks_0_title', 'Общие требования'),
(1329, 446, '_blocks_0_title', 'field_5f35b778d5142'),
(1330, 446, 'blocks_0_content_0_data', '1. Статьи в журнал принимаются на трех языках: узбекском, английском и русском. В обязательном порядке представляется перевод всей статьи на английский язык. \r\n2. Название статьи, аннотация, ключевые слова представляются на трех языках: узбекском, английском и русском.\r\n 3. Приводится УДК. \r\n4. Приводится информация об авторе(ах) статьи. Информация включает в себя (на отдельном листе): \r\n• полностью фамилия, имя, отчество автора (ов), \r\n• место работы и должность без сокращений, \r\n• контактные телефоны и электронную почту.\r\n• рубрику журнала, в которой будет размещаться статья. \r\n5. К статье прилагаются: рецензия на статью и экспертное заключение о возможности опубликования в открытой печати. \r\n6. В редакцию представляются по одному экземпляру бумажного варианта статьи с необходимыми документами и электронный вариант статьи. \r\n7. Статья должна содержать четкую постановку задачи, описание метода исследования, изложение полученных результатов и указание на область их применения. \r\n8. Объем подаваемых статей, включая иллюстрации и библиографию, не должен превышать 15 стр.'),
(1331, 446, '_blocks_0_content_0_data', 'field_5f35b7e3d5144'),
(1332, 446, 'blocks_0_content', '1'),
(1333, 446, '_blocks_0_content', 'field_5f35b788d5143'),
(1334, 446, 'blocks_1_title', 'Общие правила'),
(1335, 446, '_blocks_1_title', 'field_5f35b778d5142'),
(1336, 446, 'blocks_1_content_0_data', '1. Автор несет ответственность за приведенную информацию. \r\n2. Редакция не возвращает и не комментирует статьи. \r\n3. Редакция имеет право отправить статью на дополнительную экспертизу. \r\n4. Если статья не имеет научную ценность, не оформлена по требованию или оформлена другим форматом редакция имеет право не принимать статью.'),
(1337, 446, '_blocks_1_content_0_data', 'field_5f35b7e3d5144'),
(1338, 446, 'blocks_1_content', '1'),
(1339, 446, '_blocks_1_content', 'field_5f35b788d5143'),
(1340, 446, 'blocks_2_title', 'Рубрики журнала'),
(1341, 446, '_blocks_2_title', 'field_5f35b778d5142'),
(1342, 446, 'blocks_2_content_0_data', '1. Информатика и информационные технологии. \r\n2. Инфокоммуникационные сети и системы. \r\n3. Радиотехника, радиосвязь и телерадиовещание. \r\n4. Математическое моделирование и программирование. \r\n5. Защита информации. \r\n6. Микроэлектроника и схемотехника. \r\n7. Общественно-экономические и гуманитарные проблемы.'),
