(2299, 682, 'education-degree-group_0_education-degree', '1996-2001 - Санкт-Петербургский университет кино и телевидения, экономический факультет управления.'),
(2300, 682, 'education-degree-group_1_education-degree', '2001-2003 годы – аспирантура Санкт-Петербургского государственного университета кино и телевидения.'),
(2301, 682, 'biography_0_block-name', 'Уровень образования'),
(2302, 682, 'biography_0_biography_0_field', '1996-2001 - Санкт-Петербургский университет кино и телевидения, экономический факультет управления.'),
(2303, 682, 'biography_0_biography_1_field', '2001-2003 годы – аспирантура Санкт-Петербургского государственного университета кино и телевидения.'),
(2304, 682, 'biography_0_biography', '2'),
(2305, 682, 'biography', '6'),
(2306, 682, 'biography_1_block-name', 'Награды:'),
(2307, 682, 'biography_1_biography_0_field', '— Почетная грамота Министерства науки и высшего образования Российской Федерации за значительные заслуги в сфере образования и многолетний добросовестный труд.'),
(2308, 682, 'biography_1_biography_1_field', '— Почетная грамота Министерства науки и высшего образования Российской Федерации за значительные заслуги в сфере образования и многолетний добросовестный труд.'),
(2309, 682, 'biography_1_biography', '2'),
(2310, 682, 'biography_2_block-name', 'Этапы профессиональной деятельности:'),
(2311, 682, 'biography_2_biography_0_field', 'В СПбГИКиТ работает с 2001 года.'),
(2312, 682, 'biography_2_biography_1_field', 'С 2001г. по 2004г. – ассистент кафедры управления экономическими и социальными процессами.'),
(2313, 682, 'biography_2_biography_2_field', 'С 2004г. по настоящее время – доцент кафедры управления экономическими и социальными процессами в кино и телеиндустрии.'),
(2314, 682, 'biography_2_biography_3_field', 'С 2007г. по 2011г. – ученый секретарь диссертационного совета Д 210.021.02 по экономическим наукам при Санкт-Петербургском государственном университете кино и телевидения.'),
(2315, 682, 'biography_2_biography', '4'),
(2316, 682, 'biography_3_block-name', 'Профессиональные достижения и творческие проекты:'),
(2317, 682, 'biography_3_biography_0_field', 'За время руководства факультетом было разработано и проведено более 150 дополнительных профессиональных программ повышения квалификации и переподготовки, в том числе с использованием дистанционных образовательных технологий и электронного обучения.'),
(2318, 682, 'biography_3_biography_1_field', 'Проведено 25 дополнительных профессиональных программ по заказу Министерства культуры РФ.'),
(2319, 682, 'biography_3_biography_2_field', 'В 2019г. на факультете открыта мастерская А.Н. Сокурова «Режиссер игрового и документального фильма, режиссер монтажа».'),
