(2322, 682, 'biography_4_biography_0_field', 'Профессиональная переподготовка по ДПП \"Медиакоммуникации. Телевидение\", 2017г.'),
(2323, 682, 'biography_4_biography_1_field', 'Повышение квалификации по ДПП \"Основы педагогического мастерства, в том числе в электронной образовательной среде и инклюзивном образовании\", 2018 г.'),
(2324, 682, 'biography_4_biography_2_field', 'Ежегодное повышение квалификации по ДПП «Актуальные вопросы управления подразделение дополнительного профессионального образования»'),
