(2328, 682, 'biography_5_biography_1_field', '2. Андрей Белый. Критика. Эстетика. Теория символизма. В 2-х томах. М. Изд. «Искусство», 1994.'),
(2329, 682, 'biography_5_biography_2_field', '3. Век петербургского кино. Сб. трудов. СПб. Изд. РИИИ. 2007.'),
