(2591, 706, 'description', '«Вестник Университета» — теоретический и научно-методический журнал. Издается с января 1999 г. и входит в «Перечень ВАК» по направлениям «экономика» и «социология». \r\nЖурнал зарегистрирован в Министерстве связи и массовых коммуникаций РФ (№ 77-1361 от 10.12.1999 г.)'),
